[{"location":"examples/trend-inflation/#Trend-Inflation","page":"Trend Inflation","title":"Trend Inflation","text":"","category":"section"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"This example is a replication of the univariate state space model suggested by (Stock & Watson, 2016) using GeneralisedFilters to define a heirarchical model for use in Rao- Blackwellised particle filtering.","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"using GeneralisedFilters\nusing SSMProblems\nusing Distributions\nusing Random\nusing StatsBase\nusing LinearAlgebra\n\nconst GF = GeneralisedFilters\n","category":"page"},{"location":"examples/trend-inflation/#Model-Definition","page":"Trend Inflation","title":"Model Definition","text":"","category":"section"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"We begin by defining the local level trend model, a linear Gaussian model with a weakly stationary random walk component. The dynamics of which are as follows:","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"beginaligned\n    y_t = x_t + eta_t \n    x_t+1 = x_t + varepsilon_t\nendaligned","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"However, this model is not enough to capture trend dynamics when faced with structural breaks. (Stock & Watson, 2007) suggest adding a stochastic volatiltiy component, defined like so:","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"beginaligned\n    log sigma_eta t+1 = log sigma_eta t + nu_eta t \n    log sigma_varepsilon t+1 = log sigma_varepsilon t + nu_varepsilon t\nendaligned","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"where nu_zt sim N(0 gamma) for z in  varepsilon eta .","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"Using GeneralisedFilters, we can construct a heirarchical version of this model such that the local level trend component is conditionally linear Gaussian on the volatility draws.","category":"page"},{"location":"examples/trend-inflation/#Stochastic-Volatility-Process","page":"Trend Inflation","title":"Stochastic Volatility Process","text":"","category":"section"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"We begin by defining the non-linear dynamics, which aren't conditioned contemporaneous states. Since these processes are traditionally non-linear/non-Gaussian we use the SSMProblems interface to define the stochastic volatility components.","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"struct StochasticVolatilityPrior{T<:Real} <: StatePrior end","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"function SSMProblems.distribution(prior::StochasticVolatilityPrior{T}; kwargs...) where {T}\n    return product_distribution(Normal(zero(T), T(1)), Normal(zero(T), T(1)))\nend","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"For the dynamics, instead of using the SSMProblems.distribution utility, we only define the simulate method, which is sufficient for the RBPF.","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"struct StochasticVolatility{ΓT<:AbstractVector} <: LatentDynamics\n    γ::ΓT\nend","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"function SSMProblems.simulate(\n    rng::AbstractRNG,\n    proc::StochasticVolatility,\n    step::Integer,\n    state::AbstractVector{T};\n    kwargs...,\n) where {T<:Real}\n    new_state = deepcopy(state)\n    new_state[1:2] += proc.γ .* randn(rng, T, 2)\n    return new_state\nend","category":"page"},{"location":"examples/trend-inflation/#Local-Level-Trend-Process","page":"Trend Inflation","title":"Local Level Trend Process","text":"","category":"section"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"For the conditionally linear and Gaussian components, we subtype the model and provide a keyword argument as the conditional element. In this case A and b remain constant, but Q is conditional on the log variance, stored in new_outer (the nomenclature chosen for heirarchical modeling).","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"struct LocalLevelTrend <: LinearGaussianLatentDynamics end","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"GF.calc_A(::LocalLevelTrend, ::Integer; kwargs...) = [1;;]\nGF.calc_b(::LocalLevelTrend, ::Integer; kwargs...) = [0;]\nfunction GF.calc_Q(::LocalLevelTrend, ::Integer; new_outer, kwargs...)\n    return [exp(new_outer[1]);;]\nend","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"Similarly, we define the observation process conditional on a separate log variance.","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"struct SimpleObservation <: LinearGaussianObservationProcess end","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"GF.calc_H(::SimpleObservation, ::Integer; kwargs...) = [1;;]\nGF.calc_c(::SimpleObservation, ::Integer; kwargs...) = [0;]\nfunction GF.calc_R(::SimpleObservation, ::Integer; new_outer, kwargs...)\n    return [exp(new_outer[2]);;]\nend","category":"page"},{"location":"examples/trend-inflation/#Unobserved-Components-with-Stochastic-Volatility","page":"Trend Inflation","title":"Unobserved Components with Stochastic Volatility","text":"","category":"section"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"The state space model suggested by (Stock & Watson, 2007) can be constructed with the following method:","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"function UCSV(γ::T) where {T<:Real}\n    stoch_vol_prior = StochasticVolatilityPrior{T}()\n    stoch_vol_process = StochasticVolatility(fill(γ, 2))\n\n    local_level_model = StateSpaceModel(\n        GF.HomogeneousGaussianPrior(zeros(T, 1), Matrix(100.0I(1))),\n        LocalLevelTrend(),\n        SimpleObservation(),\n    )\n\n    return HierarchicalSSM(stoch_vol_prior, stoch_vol_process, local_level_model)\nend;","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"For plotting, we can extract the ancestry of the Rao Blackwellised particles using the callback system. For our inflation data, this reduces to the following:","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"rng = MersenneTwister(1234);\nsparse_ancestry = GF.AncestorCallback(nothing);\nstates, ll = GF.filter(\n    rng,\n    UCSV(0.2),\n    RBPF(KalmanFilter(), 2^12; threshold=1.0),\n    [[pce] for pce in fred_data.value];\n    callback=sparse_ancestry,\n);","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"The sparse_ancestry object stores a sparse ancestry tree which we can use to approximate the smoothed series without an additional backwards pass. We can convert this data structure to a human readable array by using GeneralisedFilters.get_ancestry and then take the mean path by passing a custom function.","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"trends, volatilities = mean_path(GF.get_ancestry(sparse_ancestry.tree), states);\nplot_ucsv(trends[1, :], eachrow(volatilities), fred_data)","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"<img width=1200 height=500 style='object-fit: contain; height: auto;' src=\"data:image/png;base64, \"/>","category":"page"},{"location":"examples/trend-inflation/#Outlier-Adjustments","page":"Trend Inflation","title":"Outlier Adjustments","text":"","category":"section"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"For additional robustness, (Stock & Watson, 2016) account for one-time measurement shocks and suggest an alteration in the observation equation, where","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"eta_t sim N(0 s_t cdot sigma_eta t^2) quad quad s_t sim begincases\nU(02)  text with probability  p \ndelta(1)  text with probability  1 - p\nendcases","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"The prior is the same as before, but with additional state which we can assume will always be 1; using the Distributions interface this is just Dirac(1)","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"struct OutlierAdjustedVolatilityPrior{T<:Real} <: StatePrior end","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"function SSMProblems.distribution(\n    prior::OutlierAdjustedVolatilityPrior{T}; kwargs...\n) where {T}\n    return product_distribution(Normal(zero(T), T(1)), Normal(zero(T), T(1)), Dirac(one(T)))\nend","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"In terms of the model definition, we can construct a separate LatentDynamics which contains the same volatility process as before, but with the respective draw in the third component.","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"struct OutlierAdjustedVolatility{ΓT} <: LatentDynamics\n    volatility::StochasticVolatility{ΓT}\n    switch_dist::Bernoulli\n    outlier_dist::Uniform\nend","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"The simulation then calls the volatility process, and computes the outlier term in the third state","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"function SSMProblems.simulate(\n    rng::AbstractRNG,\n    proc::OutlierAdjustedVolatility,\n    step::Integer,\n    state::AbstractVector{T};\n    kwargs...,\n) where {T<:Real}\n    new_state = SSMProblems.simulate(rng, proc.volatility, step, state; kwargs...)\n    new_state[3] = rand(rng, proc.switch_dist) ? rand(rng, proc.outlier_dist) : one(T)\n    return new_state\nend","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"For the observation process, we define a new object where R is dependent on both the measurement volatility as well as this outlier adjustment coefficient.","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"struct OutlierAdjustedObservation <: LinearGaussianObservationProcess end","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"GF.calc_H(::OutlierAdjustedObservation, ::Integer; kwargs...) = [1;;]\nGF.calc_c(::OutlierAdjustedObservation, ::Integer; kwargs...) = [0;]\nfunction GF.calc_R(::OutlierAdjustedObservation, ::Integer; new_outer, kwargs...)\n    return [new_outer[3] * exp(new_outer[2]);;]\nend","category":"page"},{"location":"examples/trend-inflation/#Outlier-Adjusted-UCSV","page":"Trend Inflation","title":"Outlier Adjusted UCSV","text":"","category":"section"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"The state space model suggested by (Stock & Watson, 2007) can be constructed with the following method:","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"function UCSVO(γ::T, prob::T) where {T<:Real}\n    stoch_vol_prior = OutlierAdjustedVolatilityPrior{T}()\n    stoch_vol_process = OutlierAdjustedVolatility(\n        StochasticVolatility(fill(γ, 2)), Bernoulli(prob), Uniform{T}(2, 10)\n    )\n\n    local_level_model = StateSpaceModel(\n        GF.HomogeneousGaussianPrior(zeros(T, 1), Matrix(100.0I(1))),\n        LocalLevelTrend(),\n        OutlierAdjustedObservation(),\n    )\n\n    return HierarchicalSSM(stoch_vol_prior, stoch_vol_process, local_level_model)\nend;","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"We then repeat the same experiment, this time with an outlier probability of p = 005","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"rng = MersenneTwister(1234);\nsparse_ancestry = GF.AncestorCallback(nothing)\nstates, ll = GF.filter(\n    rng,\n    UCSVO(0.2, 0.05),\n    RBPF(KalmanFilter(), 2^12; threshold=1.0),\n    [[pce] for pce in fred_data.value];\n    callback=sparse_ancestry,\n);","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"this process is identical to the last, except with an additional volatilities state which captures the outlier distance. We omit this feature in the plots, but the impact is clear when comparing the maximum transitory noise around the GFC.","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"trends, volatilities = mean_path(GF.get_ancestry(sparse_ancestry.tree), states);\nplot_ucsv(trends[1, :], eachrow(volatilities), fred_data)","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"<img width=1200 height=500 style='object-fit: contain; height: auto;' src=\"data:image/png;base64, \"/>","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"","category":"page"},{"location":"examples/trend-inflation/","page":"Trend Inflation","title":"Trend Inflation","text":"This page was generated using Literate.jl.","category":"page"},{"location":"#GeneralisedFilters","page":"Home","title":"GeneralisedFilters","text":"","category":"section"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"In the julia REPL:","category":"page"},{"location":"","page":"Home","title":"Home","text":"] add GeneralisedFilters","category":"page"},{"location":"#Documentation","page":"Home","title":"Documentation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"GeneralisedFilters provides implementations of various filtering and smoothing algorithms for state-space models (SSMs). The goal of the package is to provide a modular and extensible framework for implementing advanced algorithms including Rao-Blackwellised particle filters, two-filter smoothers, and particle Gibbs/conditional SMC. Performance is a primary focus of this work, with type stability, GPU-acceleration, and efficient history storage being key design goals.","category":"page"},{"location":"#Interface","page":"Home","title":"Interface","text":"","category":"section"},{"location":"#GeneralisedFilters.AncestorCallback","page":"Home","title":"GeneralisedFilters.AncestorCallback","text":"AncestorCallback\n\nA callback for sparse ancestry storage, which preallocates and returns a populated  ParticleTree object.\n\n\n\n\n\n","category":"type"},{"location":"#GeneralisedFilters.DenseAncestorCallback","page":"Home","title":"GeneralisedFilters.DenseAncestorCallback","text":"DenseAncestorCallback\n\nA callback for dense ancestry storage, which fills a DenseParticleContainer.\n\n\n\n\n\n","category":"type"},{"location":"#GeneralisedFilters.ParticleDistribution","page":"Home","title":"GeneralisedFilters.ParticleDistribution","text":"ParticleDistribution\n\nA container for particle filters which composes the weighted sample into a distibution-like object, with the states (or particles) distributed accoring to their log-weights.\n\n\n\n\n\n","category":"type"},{"location":"#GeneralisedFilters.ParticleTree","page":"Home","title":"GeneralisedFilters.ParticleTree","text":"ParticleTree\n\nA sparse container for particle ancestry, which tracks the lineage of the filtered draws.\n\nReference\n\nJacob, P., Murray L., & Rubenthaler S. (2015). Path storage in the particle  filter doi:10.1007/s11222-013-9445-x\n\n\n\n\n\n","category":"type"},{"location":"#GeneralisedFilters.RaoBlackwellisedParticle","page":"Home","title":"GeneralisedFilters.RaoBlackwellisedParticle","text":"RaoBlackwellisedParticle\n\nA container for Rao-Blackwellised states, composed of a marginalised state z (e.g. a Gaussian or Categorical distribution) and a singular state x.\n\n\n\n\n\n","category":"type"},{"location":"#GeneralisedFilters.ResamplerCallback","page":"Home","title":"GeneralisedFilters.ResamplerCallback","text":"ResamplerCallback\n\nA callback which follows the resampling indices over the filtering algorithm. This is more of a debug tool and visualizer for various resapmling algorithms.\n\n\n\n\n\n","category":"type"},{"location":"#GeneralisedFilters.initialise","page":"Home","title":"GeneralisedFilters.initialise","text":"initialise([rng,] model, algo; kwargs...)\n\nPropose an initial state distribution.\n\n\n\n\n\n","category":"function"},{"location":"#GeneralisedFilters.predict","page":"Home","title":"GeneralisedFilters.predict","text":"predict([rng,] model, algo, iter, filtered; kwargs...)\n\nPropagate the filtered distribution forward in time.\n\n\n\n\n\n","category":"function"},{"location":"#GeneralisedFilters.step","page":"Home","title":"GeneralisedFilters.step","text":"step([rng,] model, algo, iter, state, observation; kwargs...)\n\nPerform a combined predict and update call of the filtering on the state.\n\n\n\n\n\n","category":"function"},{"location":"#GeneralisedFilters.update","page":"Home","title":"GeneralisedFilters.update","text":"update(model, algo, iter, proposed, observation; kwargs...)\n\nUpdate beliefs on the propagated distribution given an observation.\n\n\n\n\n\n","category":"function"}]
